    (function() {
        function mapSelect(name, callback) {
            name = name || {};
            var that = this;
            var province = $('#' + name + '_province');
            var city = $('#' + name + '_city');
            var region = $('#' + name + '_region');

            var provinceHtmls = '<option value="">请选择省</option>';
            var cityHtml = '<option value="">请选择市</option>';
            var regionHtml = '<option value="">请选择区/县</option>';
            $.each(tammy.config.citylist, function(index, item) {
                provinceHtmls += '<option value="' + item.pid + '">' + item.p + '</option>';
            });

            province.html(provinceHtmls);
            if (city.length) {
                city.html(cityHtml);
            }

            province.off('change').on('change', function() {
                var me = $(this);
                var val = me.val();
                var text = me.text();
                var subArr = tammy.config.citylist[text];
                subArr = subArr.city;
                var str = '';
                $.each(subArr, function(index, item) {
                    debugger
                    str += '<option value="' + item.cid + '" data-province="' + text + '">' + item.c + '</option>';
                });
                $('#' + name + '_city').html(cityHtml + str).select2();

            });
            if (city.length) {
                city.off('change').on('change', function() {
                    if (region.length) {
                        var me = $(this);
                        var val = me.val();
                        var text = me.data('province');
                        var subArr = tammy.config.citylist[text];
                        subArr = subArr.city;
                        var regionList;
                        for (var i = 0; i < subArr.length; i++) {
                            var temp = subArr[i];
                            if (val == temp.cid) {
                                regionList = temp.area;
                                break;
                            }
                        }
                        var str = '';
                        $.each(regionList, function(index, item) {
                            debugger
                            str += '<option value="' + item.sid + '">' + item.s + '</option>';
                        });
                        $('#' + name + '_region').html(regionHtml + str).select2();
                    }
                });
            }

            if (typeof callback === 'function') {
                callback();
            }
        }
        tammy.utils.mapSelect = mapSelect;
    })();
